import { Component } from "react";
import React from "react";
import { PageMain, SimpleGrid, Helpers, Delimiter, DropDown, DatePicker, CellContainer } from "core";
import NotificationSystem from "react-notification-system";
import { GetUrl, HandleError } from "../../utils/generals";
import { GetGridHeaders } from "../../utils/indicators"
import Constants from '../../utils/constants'

export default class IndicatorsResultPage extends Component
{
    constructor(props)
    {
        super(props);

        this.state = {
            isLoading: true,
            indicators: [],
            indicatorId: null,
            gridHeaders: [],
            gridUpdate: 1
        };

        this.notificationSystem = React.createRef();

        this.onRoleSelected = this.onRoleSelected.bind(this);
        this.searchRole = this.searchRole.bind(this);
        this.RequestDownloadFile = this.RequestDownloadFile.bind(this);
    }

    // Events.
    componentDidMount()
    {
        Helpers.CallServer('/api/amls/DistributionOfIndicator/GetAllIndexes',
            { },
            successfulResponse =>
            {
                this.setState({ indicators: successfulResponse.data });
            },
            errorResponse => HandleError(Helpers, this.notificationSystem, errorResponse),
            () => { this.setState({ isLoading: false }) }, 'GET');
    }

    Backward(e)
    {
        e.preventDefault();
        history.back();
    }

    onRoleSelected(item)
    {
        if(item == null || item.value == null || item.value == "")
        {
            this.setState({ gridHeaders: [] });
            return;
        }
        this.setState({
            gridHeaders: GetGridHeaders(item.value),
            gridUpdate: this.state.gridUpdate + 1
        });
    }

    searchRole()
    {
        this.setState({ gridUpdate: this.state.gridUpdate + 1 });
    }

    RequestDownloadFile()
    {
        console.log("this.state.indicatorId: ", this.state.indicatorId);
        if(this.state.indicatorId == null || this.state.indicatorId == undefined || this.state.indicatorId == "")
        {
            Helpers.DisplayErrorMessage(this.notificationSystem, null, "شاخص مورد نظر را انتخاب نمایید");
            return;
        }
        Helpers.CallServer('/api/amls/Request/AddRoleRequest',
            {
                IndexValue: this.state.indicatorId,
                FromTransactionDate: this.state.fromTransactionDate,
                ToTransactionDate: this.state.toTransactionDate
            },
            successfulResponse =>
            {
                Helpers.DisplaySuccessMessage(this.notificationSystem, "در خواست دانلود شاخص با موفقیت ثبت گردید");
            },
            errorResponse => HandleError(Helpers, this.notificationSystem, errorResponse),
            () => { this.setState({ isLoading: false }) });
    }

    render()
    {
        return (
            <>
                <PageMain context={ this } title="مشاهده نتایج اجرای شاخص‌ها" icon="list-search" isLoading={ this.state.isLoading } footerLinks={[{ href: "/", text: "صفحه اصلی" }]}
                    topButtons={[
                        {
                            title: "ثبت درخواست دانلود شاخص",
                            url: this.RequestDownloadFile,
                            color: "outline-primary",
                            icon: "file-spreadsheet"
                        },
                        {
                            title: "فهرست درخواست دانلود شاخص ها",
                            url: GetUrl("indicatorsRequestListPage"),
                            color: "outline-primary",
                            icon: "list-search"
                        },
                    ]}>
                <div className="card">
                    <div className="card-body">
                        <div className="row">
                            <div className="col-4">
                                <DropDown context={ this } mdCol={ 12 } lgCol={ 12 } name="indicatorId" title="شاخص" options={ this.state.indicators } required changeHandler={ this.onRoleSelected } />
                            </div>
                            <div className="col-4">
                                <DatePicker context={ this } mdCol={ 12 } lgCol={ 12 } name="fromTransactionDate" title="تاریخ کشف معاملات مشکوک از" useEpoch />
                            </div>
                            <div className="col-4">
                                <DatePicker context={ this } mdCol={ 4 } lgCol={ 12 } name="toTransactionDate" title="تاریخ کشف معاملات مشکوک تا" useEpoch />
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-11"></div>
                            <div className="col-1 p-2">
                            <button type="button" className="d-print-none btn btn-success me-auto" onClick={ this.searchRole }>
                                <i className="me-1 ti ti-filter"></i>جستجو
                            </button>
                            </div>
                        </div>
                        {
                            this.state.indicatorId && 
                                <>
                                    <Delimiter></Delimiter>
                                    <br />
                                    <SimpleGrid context={ this } dataKey="id" minHeightTableWrapper={ Constants.MinGridHeight } hasSearchBox={ false } hideExportButton
                                        filterBgColor="primary" name="crdRegionList" title="مشاهده نتایج اجرای شاخص‌ها" notificationSystem={ this.notificationSystem }
                                        enableAutoFetch listApiUrl="/api/amls/bi/Role_01_/SearchRoles" headers={ this.state.gridHeaders } key={ this.state.gridUpdate }
                                        disabledPaging={ false }
                                        extraItemsSentToFetchData={{
                                            IndexValue: this.state.indicatorId,
                                            FromTransactionDate: this.state.fromTransactionDate,
                                            ToTransactionDate: this.state.toTransactionDate
                                        }}/>
                                </>
                        }
                    </div>
                    <div className="card-footer">
                        <div className="d-flex">
                            <a className="btn btn-outline-secendery ms-auto" onClick={ (e) => this.Backward(e) } href="/" title="بازگشت به صفحه قبل">
                            بازگشت
                            <i className="ti ti-arrow-left ms-1"></i>
                            </a>
                        </div>
                        </div>
                    </div>
                </PageMain>
                <NotificationSystem ref={ this.notificationSystem } />
            </>
        );
    }
}
